	public static String[] bubbleSort( String[] values ) {
		for(int waves = 0; waves < values.length; waves++) {
			for(int tests = 0; tests < (values.length - 1); tests++) {
				String aux = values[tests];
				if(compare(values[tests], values[tests + 1]) < 0) {
					values[tests] = values[tests + 1];
					values[tests + 1] = aux;
				}
			}
		}
		return values;
	}

	private static int compare(String name1, String name2){
		int name1Length = name1.length();
		int name2Length = name2.length();
		int limit = (name1Length > name2Length ? name2Length : name1Length);
		for(int i = 0; i < limit; i++){
			char name1Prior = name1.charAt(i);
			char name2Prior = name2.charAt(i);
			if (name1Prior != name2Prior) return name1Prior - name2Prior;
		}
		return name1Length - name2Length;
	}
